import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;

  @media (min-width: 960px) {
    width: 40%;
  }
`;

const UserCart = ({ user }) => {
  const { firstName, lastName, avatar, email } = user;
  return <div></div>;
};

export default UserCart;
